  const verification = () => {
    isLoggedIn ? setLoggedIn(false) : setLoggedIn(true);
  };
  return (
    <>
      {isLoggedIn ? (
        <PageLogin verification={() => verification()} />
      ) : (
        <div>oi</div>
      )}
    </>
  );
}

export default App;
